            if (!rootRef.current) return;

            const region = rootRef.current.querySelector('#' + regionsByMO[item.mo]);

            if (!region) return;
            
            const parentPos = rootRef.current.getBoundingClientRect();
            const childrenPos = region.getBoundingClientRect();

            const top = childrenPos.top - parentPos.top + childrenPos.height / 2.8;
